                <Link href='/auth'><a>Auth</a></Link>
            </nav>
            <main>
                {children}
            </main>
            <style jsx>{
                `
                nav {
                    position: fixed;
                    height: 60px;
                    left: 0;
                    right: 0;
                    top: 0;
                    backgraund: darkblue;
                }

                nav a {
                    color: red;
                    margin-left: 10px;
                }
                `
            }</style>
        </>
    )
}
